  const [modalOpen, setModalOpen] = useState(false);
  return (
    <div>
       <Navbar />
       <div>
       <div><Communitylist/></div>
       <img src = {chat} alt = "1"className = "chat" 
        onClick={() => {
          setModalOpen(true);
        }}
      >
        Open
      </img>

      {modalOpen && <Modal setOpenModal={setModalOpen} />}
       </div>
      <Footer/>
    </div>
     
    
  )
}
